-- trigger para actualizar el estado de un vehiculo a vendido cuando este entre el la
-- tabla de una venta. ademas hace coincidir el valor del automovil con el del sistema
-- y realiza el calculo del valor dado al cliente dependiendo del descuento registrado.

CREATE OR REPlACE FUNCTION act_vehiculo() RETURNS TRIGGER AS $actualizar$
DECLARE 
myrow administrador_vehiculonuevo%ROWTYPE;
BEGIN 	
	SELECT * INTO myrow from administrador_vehiculonuevo where vehiculo_ptr_id = NEW.vehiculo_id;
	UPDATE ventas_detalleventa SET costo = myrow.valor WHERE id = NEW.id;
	UPDATE ventas_detalleventa SET costo_venta = (myrow.valor - (myrow.valor * (NEW.dcto/100))) WHERE id = NEW.id;
	UPDATE administrador_vehiculonuevo SET vendido = True WHERE vehiculo_ptr_id = NEW.vehiculo_id;
	RETURN NULL;
	
END;
$actualizar$ LANGUAGE plpgsql;




CREATE TRIGGER triggerPodan AFTER INSERT 
ON "ventas_detalleventa" FOR EACH ROW
EXECUTE PROCEDURE act_vehiculo();
